Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    val sc = spark.sparkContext

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = sc.textFile("onsite_data.txt")

    // Load top frequent queries
    val topQueries: JavaRDD[String] = sc.textFile("top_queries.txt")

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = sc.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, Long] = Map()

    // Process onsite data
    val hitRate = onsiteData.map(line => {
      val query = line.split(" ")(0)
      val timestamp = line.split(" ")(1).toLong

      if (broadcastTopQueries.value.contains(query)) {
        if (!cache.contains(query) || timestamp - cache(query) > 12 * 60 * 60 * 1000) {
          // Cache miss
          cache(query) = timestamp
          (0, 1)
        } else {
          // Cache hit
          (1, 0)
        }
      } else {
        // Query not in top queries
        (0, 0)
      }
    }).reduce((a, b) => (a._1 + b._1, a._2 + b._2))

    // Calculate hit rate
    val hitRateValue = hitRate._1.toDouble / (hitRate._1 + hitRate._2)

    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top frequent queries to all nodes in the cluster.

The job then initializes a cache to store the timestamps of the last cache hit for each query. It processes each record in the onsite attributed data and checks if the query is in the top frequent queries. If it is, the job checks if the query is in the cache and if the current timestamp is within 12 hours of the last cache hit. If not, it is a cache miss and the query is added to the cache. If it is, it is a cache hit.

The job then calculates the hit rate by dividing the number of cache hits by the total number of queries in the onsite attributed data that are in the top frequent queries.

